import { Icon } from 'react-native-elements';
import { InputGroup, Input, IconButton } from 'rsuite';
import './styles.less';

const SelectInputSearch = ({ placeholder, ...props }) => (
    <InputGroup {...props} inside className='searchBar'>
        <Input placeholder={placeholder} />
        <InputGroup.Button>
            <Icon name="hand" />
        </InputGroup.Button>
    </InputGroup>
);

export default SelectInputSearch;
